import Airtable from "airtable";

const base = new Airtable({ apiKey: "keyHHrGcNLiewGh05" }).base(
    "appnnQqeeXZmvVJvB"
  );

export default class Conferences extends Component{
    constructor(props){
        super(props)
        this.state={employee:[]}
    }
    componentDidMount() {
        this.name = this.props.name.match.params.name;
        let a = `'${this.name}'`;
        base("Imported table")
          .select({
            view: "Grid view",
            filterByFormula: "SEARCH(" + a + ",{Participant Name})",
          })
          .eachPage((records, fetchNextPage) => {
            this.setState({ employee: records });
            fetchNextPage();
          });
      }
